      // Write the size of the element
      result[offset] = (byte) (record.size >> 24);
      result[offset + 1] = (byte) (record.size >> 16);
      result[offset + 2] = (byte) (record.size >> 8);
      result[offset + 3] = (byte) record.size;

      // Write the element
